What is the degree measure of the smallest angle in triangle $PQS$?

expected_answer:
Join $PQ$, $PR$, $PS$, $RQ$, and $RS$. Since the circles with center $Q$, $R$ and $S$ are all tangent to $BC$, then $QR$ and $RS$ are each parallel to $BC$ (as the centres $Q$, $R$ and $S$ are each 1 unit above $BC$). This tells us that $QS$ passes through $R$. When the centers of tangent circles are joined, the line segments formed pass through the associated point of tangency, and so have lengths equal to the sum of the radii of those circles. Therefore, $QR=RS=PR=PS=1+1=2$.

[asy]
size(200);
pair P, Q, R, S;
Q=(0,0);
R=(2,0);
S=(4,0);
P=(3,1.732);
label("Q", Q, SW);
label("R", R, dir(270));
label("S", S, SE);
label("P", P, N);
draw(circle(Q,1), dashed);
draw(circle(P,1), dashed);
draw(circle(R,1), dashed);
draw(circle(S,1), dashed);
draw(P--Q--S--P--R);
[/asy]

Since $PR=PS=RS$, we know $\triangle PRS$ is equilateral, so $\angle PSR=\angle PRS=60^\circ$.  Since $\angle PRS=60^\circ$ and $QRS$ is a straight line, we have $\angle QRP=180^\circ-60^\circ=120^\circ$. Since $QR=RP$, we know $\triangle QRP$ is isosceles, so $$\angle PQR = \frac{1}{2}(180^\circ-120^\circ)= 30^\circ.$$Since $\angle PQS=30^\circ$ and $\angle PSQ=60^\circ$, we have $\angle QPS = 180^\circ - 30^\circ - 60^\circ = 90^\circ$, so $\triangle PQS$ is a $30^\circ$-$60^\circ$-$90^\circ$ triangle. Thus, the answer is $\boxed{30^\circ}$.

The midpoint of $(5,0)$ and $(4,3)$ is
\[\left( \frac{5 + 4}{2}, \frac{0 + 3}{2} \right) = \left( \frac{9}{2}, \frac{3}{2} \right).\]This tells us that the vector being reflected over is a scalar multiple of $\begin{pmatrix} \frac{9}{2} \\ \frac{3}{2} \end{pmatrix}.$  We can then assume that the vector being reflected over is $\begin{pmatrix} 3 \\ 1 \end{pmatrix}.$

[asy]
usepackage("amsmath");

unitsize(1 cm);

pair A, B, M, O, R, S;

O = (0,0);
A = (5,0);
R = (4,3);
B = (-2,3);
S = (1/5,-18/5);
M = (A + R)/2;

draw((-3,-1)--(5,5/3),red + dashed);
draw(O--M,red,Arrow(6));
draw((-4,0)--(6,0));
draw((0,-4)--(0,4));
draw(O--A,Arrow(6));
draw(O--R,Arrow(6));
draw(A--R,dashed,Arrow(6));
draw(O--B,Arrow(6));
draw(O--S,Arrow(6));
draw(B--S,dashed,Arrow(6));
label("$\begin{pmatrix} 5 \\ 0 \end{pmatrix}$", A, S);
label("$\begin{pmatrix} 4 \\ 3 \end{pmatrix}$", R, NE);
label("$\begin{pmatrix} -2 \\ 3 \end{pmatrix}$", B, NW);
label("$\begin{pmatrix} \frac{9}{2} \\ \frac{3}{2} \end{pmatrix}$", M, N);
[/asy]

The projection of $\begin{pmatrix} -2 \\ 3 \end{pmatrix}$ onto $\begin{pmatrix} 3 \\ 1 \end{pmatrix}$ is
\[\operatorname{proj}_{\begin{pmatrix} 3 \\ 1 \end{pmatrix}} \begin{pmatrix} -2 \\ 3 \end{pmatrix} = \frac{\begin{pmatrix} -2 \\ 3 \end{pmatrix} \cdot \begin{pmatrix} 3 \\ 1 \end{pmatrix}}{\begin{pmatrix} 3 \\ 1 \end{pmatrix} \cdot \begin{pmatrix} 3 \\ 1 \end{pmatrix}} \begin{pmatrix} 3 \\ 1 \end{pmatrix} = \frac{-3}{10} \begin{pmatrix} 3 \\ 1 \end{pmatrix} = \begin{pmatrix} -\frac{9}{10} \\ -\frac{3}{10} \end{pmatrix}.\]Hence, the reflection of $\begin{pmatrix} -2 \\ 3 \end{pmatrix}$ is $2 \begin{pmatrix} -\frac{9}{10} \\ -\frac{3}{10} \end{pmatrix} - \begin{pmatrix} -2 \\ 3 \end{pmatrix} = \boxed{\begin{pmatrix} 1/5 \\ -18/5 \end{pmatrix}}.$

